var OnSuccessEmpresa,onFailureEmpresa;$(function(){const n=$("#modalEmpresaMant"),t=$("#frmEmpresaMant");OnSuccessEmpresa=function(i){t.find("span[data-valmsg-for]").text("");i.Success===!0?(swal("Bien!","Registro Guardado Correctamente","success"),n.modal("hide")):(i.Errors&&$.each(i.Errors,function(n,t){$("span[data-valmsg-for="+t.Key+"]").length!==0&&$("span[data-valmsg-for="+t.Key+"]").text(t.Message)}),swal("Algo Salio Mal!",i.Message?i.Message:"Verifique los campos ingresados","error"))};onFailureEmpresa=function(){swal("Algo Salio Mal!","Ocurrio un error al Guardar","error")};n.on("hidden.bs.modal",function(){$(this).parent().remove()});n.modal("show")});